func maximum(s, p string, removable []int, low, high int) int {
	if low == high {
		if low != 0 {
			return low + 1
		} else {

			picked := make([]bool, len(s), len(s))
			picked[removable[0]] = true
			if findSolution(s, p, picked) {
				return 1
			}
		}
		return 0
	}
	var k = (low + high + 1) / 2

	picked := make([]bool, len(s), len(s))
	for i := 0; i <= k; i++ {
		picked[removable[i]] = true
	}

	if !findSolution(s, p, picked) {
		return maximum(s, p, removable, low, k-1)
	}
	return maximum(s, p, removable, k, high)
}

func maximumRemovals(s string, p string, removable []int) int {
	if len(s) == 0 {
		return 0
	}
	if len(p) == 0 {
		return len(removable)
	}
	return maximum(s, p, removable, 0, len(removable)-1)
}

// find a way to walk from (0, 0) to (. , len(p))
func findSolution(s string, p string, picked []bool) bool {
	var si = 0
	var pi = 0

	// do greedy algorithm
	for pi < len(p) {
		var find = false
		for si < len(s) {
			if picked[si] {
				si += 1
				continue
			}
			if s[si] == p[pi] {
				find = true
				si += 1
				break
			}
			si += 1
		}
		if !find {
			return false
		}
		pi++
	}
	return pi == len(p)
}
